import React from 'react';
import Card from "../card/Card";
import classes from "./CardList.module.css"

const CardList = ({cards}) => {
    return (
        <section className={classes.row}>
            {cards.map(item=><Card props={item}/>)}
            <Card/>
        </section>
    );
};

export default CardList;
